import React, { useState, useEffect, useRef } from 'react';
import { motion } from 'framer-motion';
import { 
  Home, Settings, BarChart3, Users, Clock, TrendingUp, 
  Play, Square, RotateCcw, Brain, History, CheckCircle, 
  AlertTriangle, X, Activity, Percent, Gauge
} from 'lucide-react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, BarChart, Bar } from 'recharts';

const PerformancePage = ({ onNavigate }) => {
  const [testConfig, setTestConfig] = useState({
    type: 'load',
    targetUrl: 'http://localhost:3000',
    userCount: 100,
    duration: 60,
    rampUp: 10,
    thinkTime: 1000
  });
  
  const [isTestRunning, setIsTestRunning] = useState(false);
  const [showMonitoring, setShowMonitoring] = useState(false);
  const [showResults, setShowResults] = useState(false);
  const [testProgress, setTestProgress] = useState(0);
  const [realTimeData, setRealTimeData] = useState({
    activeUsers: 0,
    avgResponseTime: 0,
    successRate: 0,
    requestsPerSecond: 0
  });
  
  const [testResults, setTestResults] = useState({
    totalRequests: 1000,
    successfulRequests: 950,
    failedRequests: 50,
    avgResponseTime: 250,
    percentile95: 450,
    peakRPS: 45
  });
  
  const [testHistory, setTestHistory] = useState([
    {
      id: 1,
      type: "Load Test",
      userCount: 100,
      status: "Completed successfully",
      successRate: 98,
      avgResponse: 245,
      peakRPS: 42,
      timestamp: "2 minutes ago",
      icon: "check",
      iconClass: "success"
    },
    {
      id: 2,
      type: "Stress Test",
      userCount: 500,
      status: "Good performance with minor issues",
      successRate: 87,
      avgResponse: 380,
      peakRPS: 78,
      timestamp: "15 minutes ago",
      icon: "exclamation-triangle",
      iconClass: "warning"
    }
  ]);
  const [testData, setTestData] = useState({
    labels: [],
    responseTimes: [],
    requestsPerSecond: [],
    successRate: []
  });
  
  const testIntervalRef = useRef(null);
  const elapsedTimeRef = useRef(0);

  // Test type presets
  const testTypePresets = {
    load: { userCount: 100, duration: 60 },
    stress: { userCount: 500, duration: 120 },
    spike: { userCount: 1000, duration: 30 },
    soak: { userCount: 200, duration: 7200 }
  };

  const handleTestTypeChange = (type) => {
    const preset = testTypePresets[type];
    setTestConfig(prev => ({
      ...prev,
      type,
      userCount: preset.userCount,
      duration: preset.duration
    }));
  };

  const startTest = async () => {
    if (!testConfig.targetUrl.trim()) {
      alert('Please enter a target URL');
      return;
    }

    setIsTestRunning(true);
    setShowMonitoring(true);
    setShowResults(false);
    setTestProgress(0);
    elapsedTimeRef.current = 0;

    // Reset test data
    setTestData({
      labels: [],
      responseTimes: [],
      requestsPerSecond: [],
      successRate: []
    });

    // Start monitoring
    startMonitoring();
  };

  const startMonitoring = () => {
    testIntervalRef.current = setInterval(() => {
      elapsedTimeRef.current += 1;
      const progress = Math.min((elapsedTimeRef.current / testConfig.duration) * 100, 100);
      setTestProgress(progress);

      // Simulate real-time data
      const responseTime = Math.random() * 500 + 100;
      const rps = Math.random() * 50 + 10;
      const successRate = Math.random() * 20 + 80;
      const activeUsers = Math.min(elapsedTimeRef.current * 10, testConfig.userCount);

      setRealTimeData({
        activeUsers,
        avgResponseTime: Math.round(responseTime),
        successRate: Math.round(successRate),
        requestsPerSecond: Math.round(rps)
      });

      // Update test data for charts
      const timeLabel = elapsedTimeRef.current + 's';
      setTestData(prev => {
        const newLabels = [...prev.labels, timeLabel];
        const newResponseTimes = [...prev.responseTimes, responseTime];
        const newRequestsPerSecond = [...prev.requestsPerSecond, rps];
        const newSuccessRate = [...prev.successRate, successRate];

        // Keep only last 20 data points
        if (newLabels.length > 20) {
          newLabels.shift();
          newResponseTimes.shift();
          newRequestsPerSecond.shift();
          newSuccessRate.shift();
        }

        return {
          labels: newLabels,
          responseTimes: newResponseTimes,
          requestsPerSecond: newRequestsPerSecond,
          successRate: newSuccessRate
        };
      });

      // Check if test is complete
      if (elapsedTimeRef.current >= testConfig.duration) {
        stopTest();
      }
    }, 1000);
  };

  const stopTest = () => {
    if (testIntervalRef.current) {
      clearInterval(testIntervalRef.current);
      testIntervalRef.current = null;
    }

    setIsTestRunning(false);
    setShowResults(true);

    // Calculate final results with proper error handling
    const responseTimesCount = testData.responseTimes.length;
    
    if (responseTimesCount === 0) {
      // If no data was collected, set default values
      setTestResults({
        totalRequests: 0,
        successfulRequests: 0,
        failedRequests: 0,
        avgResponseTime: 0,
        percentile95: 0,
        peakRPS: 0
      });
      addTestToHistory(0, 0, 0);
      return;
    }

    // Calculate total requests based on actual test data
    const totalRequests = Math.max(1, responseTimesCount * Math.round(testConfig.userCount / 10));
    
    // Calculate average success rate
    const avgSuccessRate = testData.successRate.length > 0 
      ? testData.successRate.reduce((a, b) => a + b, 0) / testData.successRate.length 
      : 95; // Default to 95% if no data
    
    const successfulRequests = Math.round(totalRequests * (avgSuccessRate / 100));
    const failedRequests = Math.max(0, totalRequests - successfulRequests);
    
    // Calculate average response time
    const avgResponse = testData.responseTimes.reduce((a, b) => a + b, 0) / responseTimesCount;
    
    // Calculate 95th percentile
    const sortedTimes = [...testData.responseTimes].sort((a, b) => a - b);
    const percentileIndex = Math.floor(responseTimesCount * 0.95);
    const percentile95 = sortedTimes[percentileIndex] || avgResponse;
    
    // Calculate peak RPS
    const peakRPS = testData.requestsPerSecond.length > 0 
      ? Math.max(...testData.requestsPerSecond) 
      : 0;

    setTestResults({
      totalRequests,
      successfulRequests,
      failedRequests,
      avgResponseTime: Math.round(avgResponse),
      percentile95: Math.round(percentile95),
      peakRPS: Math.round(peakRPS)
    });

    // Add to test history
    addTestToHistory(avgSuccessRate, avgResponse, peakRPS);
  };

  const resetTest = () => {
    if (testIntervalRef.current) {
      clearInterval(testIntervalRef.current);
      testIntervalRef.current = null;
    }

    setIsTestRunning(false);
    setShowMonitoring(false);
    setShowResults(false);
    setTestProgress(0);
    setRealTimeData({
      activeUsers: 0,
      avgResponseTime: 0,
      successRate: 0,
      requestsPerSecond: 0
    });
  };

  const generateAIAnalysis = (testResults, successRate) => {
    const analysis = {
      performance: '',
      insights: [],
      bottlenecks: [],
      recommendations: [],
      readiness: ''
    };

    // Performance assessment
    if (successRate >= 95) {
      analysis.performance = 'Excellent Performance';
    } else if (successRate >= 85) {
      analysis.performance = 'Good Performance';
    } else if (successRate >= 70) {
      analysis.performance = 'Moderate Performance Issues';
    } else {
      analysis.performance = 'Critical Performance Issues';
    }

    // AI Insights based on metrics
    if (testResults.avgResponseTime < 200) {
      analysis.insights.push('Response times are excellent and well within acceptable range');
    } else if (testResults.avgResponseTime < 500) {
      analysis.insights.push('Response times are good but could be optimized');
    } else {
      analysis.insights.push('Response times are higher than ideal and need attention');
    }

    if (testResults.peakRPS > 100) {
      analysis.insights.push('System demonstrates excellent throughput capabilities');
    } else if (testResults.peakRPS > 50) {
      analysis.insights.push('System shows good throughput under load');
    } else {
      analysis.insights.push('Throughput is lower than expected for this load level');
    }

    if (testResults.percentile95 < testResults.avgResponseTime * 2) {
      analysis.insights.push('Response time distribution is consistent and stable');
    } else {
      analysis.insights.push('High response time variance indicates potential instability');
    }

    // Potential Bottlenecks
    if (testResults.avgResponseTime > 1000) {
      analysis.bottlenecks.push('Response times are significantly high, indicating server-side bottlenecks');
    }
    
    if (testResults.failedRequests > testResults.totalRequests * 0.1) {
      analysis.bottlenecks.push('High failure rate suggests system reliability issues');
    }
    
    if (testResults.peakRPS < testResults.userCount * 0.1) {
      analysis.bottlenecks.push('Low throughput relative to user count indicates capacity constraints');
    }

    if (testResults.percentile95 > testResults.avgResponseTime * 3) {
      analysis.bottlenecks.push('High 95th percentile indicates inconsistent performance');
    }

    // AI Recommendations
    if (testResults.avgResponseTime > 500) {
      analysis.recommendations.push('Implement response caching to reduce server load');
      analysis.recommendations.push('Optimize database queries and add database indexing');
    }
    
    if (testResults.failedRequests > 0) {
      analysis.recommendations.push('Implement retry mechanisms for failed requests');
      analysis.recommendations.push('Add error monitoring and alerting systems');
    }
    
    if (testResults.peakRPS < 50) {
      analysis.recommendations.push('Consider horizontal scaling or load balancing');
      analysis.recommendations.push('Optimize application code for better performance');
    }
    
    if (testResults.percentile95 > testResults.avgResponseTime * 2) {
      analysis.recommendations.push('Implement connection pooling for better resource management');
      analysis.recommendations.push('Add performance monitoring and profiling tools');
    }

    // Production Readiness
    if (successRate >= 95 && testResults.avgResponseTime < 500 && testResults.failedRequests < testResults.totalRequests * 0.05) {
      analysis.readiness = 'System is ready for production deployment with excellent performance metrics';
    } else if (successRate >= 85 && testResults.avgResponseTime < 1000) {
      analysis.readiness = 'System is ready for production with minor optimizations recommended';
    } else if (successRate >= 70) {
      analysis.readiness = 'System needs performance improvements before production deployment';
    } else {
      analysis.readiness = 'System requires significant optimization before production deployment';
    }

    return analysis;
  };

  const addTestToHistory = (successRate, avgResponse, peakRPS) => {
    const testTypeDisplay = testConfig.type.charAt(0).toUpperCase() + testConfig.type.slice(1) + ' Test';
    
    let status = 'Completed successfully';
    let icon = 'check';
    let iconClass = 'success';
    
    if (successRate < 85) {
      status = 'Performance issues detected';
      icon = 'times';
      iconClass = 'error';
    } else if (successRate < 95) {
      status = 'Good performance with minor issues';
      icon = 'exclamation-triangle';
      iconClass = 'warning';
    }

    const newHistoryItem = {
      id: Date.now(),
      type: testTypeDisplay,
      userCount: testConfig.userCount,
      status,
      successRate: Math.round(successRate),
      avgResponse: Math.round(avgResponse),
      peakRPS: Math.round(peakRPS),
      timestamp: 'Just now',
      icon,
      iconClass
    };

    setTestHistory(prev => [newHistoryItem, ...prev.slice(0, 4)]); // Keep only last 5 items
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'success': return '#4ecdc4';
      case 'warning': return '#feca57';
      case 'error': return '#ff6b6b';
      default: return '#6B7280';
    }
  };

  const getStatusIcon = (icon) => {
    switch (icon) {
      case 'check': return CheckCircle;
      case 'exclamation-triangle': return AlertTriangle;
      case 'times': return X;
      default: return Activity;
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-900 via-purple-900 to-slate-900">
      {/* Header */}
      <header className="bg-white/10 backdrop-blur-md border-b border-white/20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center space-x-4">
              <div className="flex items-center space-x-2">
                <Settings className="h-8 w-8 text-purple-400" />
                <h1 className="text-xl font-bold text-white">Performance Testing Suite</h1>
              </div>
            </div>
            
            {/* Navigation */}
            <nav className="flex space-x-6">
              <button 
                onClick={() => onNavigate('home')}
                className="flex items-center space-x-2 text-gray-300 hover:text-white transition-colors"
              >
                <Home className="h-5 w-5" />
                <span>Home</span>
              </button>
              <button 
                onClick={() => onNavigate('performance')}
                className="flex items-center space-x-2 text-purple-400 border-b-2 border-purple-400 transition-colors"
              >
                <Settings className="h-5 w-5" />
                <span>Performance Testing</span>
              </button>
              <button 
                onClick={() => onNavigate('dashboard')}
