                         { range: '300-400ms', count: 180 },
                         { range: '400-500ms', count: 50 },
                         { range: '500ms+', count: 20 }
                       ]}>
                         <CartesianGrid strokeDasharray="3 3" stroke="#374151" />
                         <XAxis dataKey="range" stroke="#9CA3AF" />
                         <YAxis stroke="#9CA3AF" />
                         <Tooltip 
                           contentStyle={{ 
